import React, { useEffect } from 'react';
import { useParams, Link } from 'react-router-dom';
import { useDispatch, useSelector } from 'react-redux';
import { verifikimi } from '../actions/SingupAction';
import { getInfermiers } from '../actions/InfermieretActions';
import Infermier from './Infermieret/infermier';
import { useState } from 'react';
function InfermierList() {
    const { qytetiId, spitaliId, repartiId } = useParams();
    const dispatch = useDispatch();
    const [isAuthenticated, setIsAuthenticated] = useState(null);
    useEffect(() => {
        const token = localStorage.getItem('jwtToken');
        if (!token) {
            setIsAuthenticated(false);
        } else {
            dispatch(verifikimi(token)).then(response => {
                setIsAuthenticated(response.status);
            });
        }
    }, [dispatch]);

    if (isAuthenticated === null) {
        return <p>Loading...</p>;
    }

    if (isAuthenticated === false) {
        return <p>Unauthorized. Please <Link to="/signin">sign in</Link>.</p>;
    }
    useEffect(() => {
        dispatch(getInfermiers(qytetiId, spitaliId, repartiId));
    }, [dispatch, qytetiId, spitaliId, repartiId]);

    const infermierlist = useSelector((state) => state.infermieriReducerContent.infermierts) || [];

    return (
        <div className="container">
            <Link to={""} className="btn btn-danger">
                Create Employee
            </Link>
            <hr />
            {infermierlist.map((infermier) => (
                <Infermier
                    key={infermier.id}
                    infermier={infermier}
                     qytetiId={qytetiId} // Pass qytetiId here
                    spitaliId={spitaliId} 
                    repartiId={repartiId}// Pass spitaliId here
                />
            ))}
        </div>
    );
}
    /*return (
        <div className="container">
            <Link to={`/createEmployee/${qytetiId}/${spitaliId}/${repartiId}`} className="btn btn-danger">
                Create Employee
            </Link>
            <hr />
            {infermierlist.length > 0 ? (
                infermierlist.map((infermier) => (
                    <Infermier
                        key={infermier.id}
                        infermier={infermier}
                        qytetiId={qytetiId}
                        spitaliId={spitaliId}
                        repartiId={repartiId}
                    />
                ))}
        </div>
    );
}*/

export default InfermierList;
